【商品説明】<br>玄関につるだけ簡単なネットタイプの虫よけ。玄関にぴったりな落ち着いたブラウン色。ドアに設置しても薬剤が広がるサイドスリットと特殊ネットを採用。子供が薬剤に触れにくい安全設計の容器。フックと吊り下げヒモが選べて、どんな玄関でも吊りやすい。トランスフルトリンとエムペントリンの２つの薬剤配合。交換時期がひと目で分かる液体タイプのお取替えサイン付。<br>商品区分：日用雑貨品・他<br>問い合わせ先：<BR>アース製薬株式会社　お客様相談窓口。0120-81-6545。午前9：00-午後5：00（土・日・祝を除く）<br>原産国：日本<br>商品サイズ：111×232×39<BR><br>JANコード：4901080191113<BR>cs：24<BR><br>商品区分：日用雑貨品・他<br>問い合わせ先：アース製薬株式会社　お客様相談窓口。0120-81-6545。午前9：00-午後5：00（土・日・祝を除く）<br>原産国：日本<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
