バポナ うじ殺し 500ml<br>ブランド：バポナ<br>販売・製造元：アース製薬<br><br>液剤なので、ウジ・ボウフラの発生源にすばやく拡散し、駆除する殺虫剤。<br>また、トイレやゴミ捨て場など、悪臭の発生源を防臭します。<br> <br><br><br>使用方法<br>・目的に応じて、そのまま又は水で希釈し、ハエ幼虫(ウジ)、蚊幼虫(ボウフラ)の発生または生息する場所に散布する。<br>・ハエ幼虫(ウジ)：1平方あたり本品50-100mlを幼虫の発生場所に散布する。<br>ゴミや堆肥の場合はよく内部までしみ込むように適宜希釈して散布する。<br>・蚊幼虫(ボウフラ)：発生場所の水量100Lにつき本品20-40mlを散布する。<br> <br><br>使用上の注意<br>●してはいけないこと・薬剤を目や口に入れないこと。<br>・小分けしたり、他の容器に移し替えないこと。<br>・水で希釈する場合は、食品用の容器の他、誤用のおそれのあるものを使用しないこと。<br>また、直接手でかき混ぜないこと。<br>●相談すること・万一身体に異常が起きた場合や誤って飲み込んだ場合は、できるだけ本品を持って直ちに本品がオルトジクロロベンゼンとクレゾールが含まれていることを医師に告げて診療を受けること。<br>●その他の注意・定められた用法及び用量を厳守すること。<br>・水域に使用する場合は、魚や水棲生物に対して配慮して使用すること。<br>・シミ、変色、変形などの原因となるので塗装面やプラスチック、石材、漆喰 、白木などに薬剤が付着しないようにし、付着した場合は直ちにふきとるか水で洗い流すこと。<br>・プラスチック製の便槽、下水管には使用しないこと。<br>・皮膚、飲食物、食器、小児のおもちゃ、飼料、観賞魚、小鳥などのペット類などにかからないようにすること。<br>・薬剤が皮膚に付いたときは、石けん水でよく洗うこと。<br>また目に入った場合は、直ちに水で洗いながすこと。<br>・飲食物などと区別し、飲み物と間違われないようにすること。<br>・使用後、残った薬剤は、栓を確実に締め付け、必ず保管場所に戻すこと。<br>・使用済みの空容器等は、石けん水でよくすすぎ、適切に処分すること。<br>●保管及び取り扱い上の注意食品、食器、飼料等と区別し、高温直射日光を裂け、小児の手の届かない所に保管すること。<br> <br>成分<br>有効成分：オルトジクロロベンゼンその他の成分：クレゾール、ドデシルベンゼンスルホン酸ナトリウム、ヒマシ油硫酸ナトリウム、オレイン酸POE(20)ソルビタン、イソプロパノール <br>日用品／虫よけ・殺虫剤・忌避／殺虫剤／殺虫剤 うじ用<br>JANコード： 4901080851314<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
