ネズミ一発退場<br>ブランド：アース<br>販売・製造元：アース製薬<br><br>ハッカオイルと琉球ハーブ(月桃)を主体とする天然ハーブと、煙成分でネズミを一発で退散させるねずみ忌避剤。<br>天然ハーブを含んだ煙の力で、倉庫や屋根裏、通路、床下などの住まいからねずみを追い出します。<br> <br>用途・ネズミの忌避、侵入防止・ネズミによる被害の防止 <br><br>使用方法<br>1.プラスチック容器から薬剤缶を取り出し、付属の水袋の水を全部入れる。<br>2.天井裏や床下、倉庫などネズミを追い出したい場所に容器を水平に設置し、その中に薬剤缶を入れ、リング状のフタをする。<br>(1-2分後に薬剤が蒸散し始めます。<br>)3.蒸散開始後2時間またはそれ以上、そのまま放置してください。<br>(蒸散は約10分で終わります。<br>)4.使用後はじゅうぶんに換気を行ってください。<br>●ご使用の目安は、6畳-12畳に、1個の割合です。<br> 保管方法湿気を避け、子どもの手の届かない涼しいところに保管してください。<br> <br>日用品／虫よけ・殺虫剤・忌避／忌避用品／ねずみ忌避剤<br>JANコード： 4901080254016<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
