商品名：天然ハーブ防虫剤　洋服ダンス用<br>内容量：2枚<br>ブランド：天然ハーブ防虫剤<br>原産国：日本<br><br>天然防虫で安心＆爽やか！衣類にも人にも優しい防虫剤<br>ユーカリとミントから抽出した天然ハーブ成分が衣類を虫から守ります。爽やかなユーカリ・ミントの香りで気分もリフレッシュ。他の防虫剤と一緒に使えます。吊り下げに便利なフック付き。金糸、銀糸、ラメ加工品、和服、皮革製品にも使用できます。有効期限（６か月）を過ぎたら除湿剤として再利用できます。<br>成分：植物成分（ユーカリ油、ハッカ油）<br>使用方法：袋から取り出し、洋服ダンス２シート吊るしてご使用ください。\n付属の取り替えシールに取り替え時期を記入し、防虫剤に貼ってください。\n残って防虫剤は袋のチャックをしっかり密封してください。密封が悪いと防虫成分揮発して効果がうすれることがあります。\n衣類についた防虫剤のニオイが気になる方は、半日程度風通しの良いところにおかけください。\n除湿剤として再利用される場合は、使用後の防虫剤を半日程度天日干ししてご使用ください。また、当社別売りの「除湿シート/洋服ダンス用」を併用するとより効果的です。<br>問合せ先：０１２０－５８０－１２０<br><br>JANコード:4950367052630<br><br><br>商品番号：101-55102<br><br><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
